import React from 'react'
import { useHistory } from "react-router-dom";

function Menu() {
  const history = useHistory();
  const pack = () => {
    history.push("/home/package");
  }
  const pro = () => {
    history.push("/home/product");
  }
  const rental = () => {
    history.push("/home/myrental");
  }
  const profile = () => {
    history.push("/home/editprofile");
  }
  return (
    <div>
      <ul>
        <li onClick={() => pack()}>Packages</li>
        <li onClick={() => pro()}>Products</li>
        <li onClick={() => rental()}>My Rental</li>
        <li onClick={() => profile()}>Edit Profile</li>
      </ul>
    </div>
  )
}

export default Menu
